package main

import (
	"fmt"
	"math"
)

func findBestValue(arr []int, target int) int {
	if len(arr) == 0 {
		return 0
	}

	left := 0
	right := arr[0]
	for i := 1; i < len(arr); i++ {
		right = max(right, arr[i])
	}

	var mid int
	for left < right {
		mid = left + (right-left)/2

		cur := calcSum(arr, mid)

		if cur > target {
			right = mid
		} else if cur < target {
			left = mid + 1
		} else {
			break
		}
	}

	res1 := calcSum(arr, left-1)
	res2 := calcSum(arr, left)
	if math.Abs(float64(target-res1)) <= math.Abs(float64(res2-target)) {
		return left - 1
	}

	return left
}

func calcSum(arr []int, threshold int) int {
	sum := 0

	for _, item := range arr {
		if item > threshold {
			sum += threshold
		} else {
			sum += item
		}
	}

	return sum
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}

